function telemetryStart($injector) {
  var telemetryEnabled = $injector.get('telemetryEnabled');

  if (telemetryEnabled) {
    var Private = $injector.get('Private');
    // no telemetry for non-logged in users
    if (Private(_path.PathProvider).isUnauthenticated()) {
      return;
    }

    var $http = $injector.get('$http');
    var sender = new _telemetry.Telemetry($injector, function () {
      return (0, _fetch_telemetry.fetchTelemetry)($http);
    });

    sender.start();
  }
}

_modules.uiModules.get('xpack_main/hacks').run(telemetryStart);
